import React from 'react';

const Sidebar: React.FC = () => {
    return (
        <aside className="bg-gray-200 p-4">
            <nav>
                <ul>
                    <li>Link 1</li>
                    <li>Link 2</li>
                    <li>Link 3</li>
                </ul>
            </nav>
        </aside>
    );
};

export default Sidebar;
